msg: "The contribution of others, like Halley, continues to be largely downgraded.\r\nYou'll require a shelter you can line with clean straw or perhaps a blanket to keep your dog warm, especially if you live in a location the location where the \r\ntemperatures drop.  Lay the 3rd layer of boards perpendicular to the \r\nfirst layer, and attach the same manner you probably did \r\nwith the second layer."
